import React, { Component } from 'react'
import { Container, Header, Input, Segment, Table, Grid, Button } from 'semantic-ui-react';
import '../App.css';

class signInPage extends Component {
  render() {
    return (
      <Container>
        <Segment color='purple' style={{marginTop: '30px'}}>
          <Header>
          PLEASE SIGN IN WITH YOUR NETID
          </Header>
          <Grid centered >
          <Grid.Row>
            <Input id="source" label="Source" value={newSource} onChange={onChange} />
          </Grid.Row>
          <Grid.Row>
            <Input id="entityType" label="Entity" value={newEntity} onChange={onChange} />
          </Grid.Row>
        </Grid>
        </Segment>
      </Container>
    )
  }
}

export default signInPage
